// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./Staking/StakingToken.sol";

contract StakingLimit is Ownable, StakingToken {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    // Rate Denominator
    uint256 public constant rateDenominator = 100;
    // Cap Stake Amount
    uint256 public cap;
    // Max Stake Amount
    uint256 public maxStakingAmount;
    // Min Stake Amount
    uint256 public minStakingAmount;
    // Token Wallet, token out address
    address public tokenWallet;
    // rewards rate list
    address[] public rewardsTokenList;
    // rewards rate info struct
    struct RewardsRateInfo {
        address rewardsToken;
        uint256 rewardsRate;
    }
    // Token rewards rate List
    mapping(address => RewardsRateInfo) public rewardsRateInfoList;

    /********** constructor contract *********/
    constructor(
        address _stakingToken, // staking token address
        address _tokenWallet, // token out address wallet
        address payable _wallet, // receive token address wallet
        uint256 _duration, // duration
        uint256 _stageCliffUnit,
        uint256 _cap, // 
        uint256 _maxStakingAmount,
        uint256 _minStakingAmount
    )
        StakingToken(_wallet, _stakingToken, _duration, _stageCliffUnit) {
        require(_tokenWallet != address(0), "StakingLimit: token wallet is the zero address");
        require(_minStakingAmount > 0, "StakingLimit: The minimum staking amount is greater than 0");
        require(_maxStakingAmount >= _minStakingAmount, "StakingLimit: The maximum staking amount is greater than the minimum staking amount");
        require(_maxStakingAmount <= _cap, "StakingLimit: The maximum staking amount must be less than the cap");

        tokenWallet = _tokenWallet;
        cap = _cap;
        maxStakingAmount = _maxStakingAmount;
        minStakingAmount = _minStakingAmount;
    }

    /********** Owner Functions *********/
    // set duration
    function setDuration(uint256 _duration) public onlyOwner {
        require(_duration >= 0, 'StakingLimit: duration is greater than 0');
        duration = _duration;
    }
    // set Interval Duration
    function setStageCliffUnit(uint256 timeUnit) public onlyOwner {
        require(timeUnit >= 0, 'StakingLimit: stageCliffUnit is greater than 0');
        stageCliffUnit = timeUnit;
    }
    // set cap amount
    function setCap(uint256 amount) public onlyOwner {
        cap = amount;
    }
    // set max staking amount
    function setMaxStakingAmount(uint256 amount) public onlyOwner {
        require(amount <= cap, "StakingLimit: The maximum staking amount must be less than the cap");
        require(amount >= minStakingAmount, "StakingLimit: The maximum staking amount is greater than the minimum staking amount");
        maxStakingAmount = amount;
    }
    // set min staking amount
    function setMinStakingAmount(uint256 amount) public onlyOwner {
        require(amount > 0, "StakingLimit: The minimum staking amount is greater than 0");
        require(amount <= maxStakingAmount, "StakingLimit: The minimum staking amount must be less than the maxStakingAmount");
        minStakingAmount = amount;
    }
    // set rewards rate
    function setRewardsRate(address token, uint256 rate) public onlyOwner {
        require(token != address(0), "StakingLimit: token is the zero address");
        require(rate >= 0, 'StakingLimit: rate is greater than or equal 0');
        RewardsRateInfo storage info = rewardsRateInfoList[token];
        if (info.rewardsToken != address(0)) {
            info.rewardsRate = rate;
        } else {
            rewardsRateInfoList[token] = RewardsRateInfo({
                rewardsToken: token,
                rewardsRate: rate
            });
            rewardsTokenList.push(token);
        }
    }

    /********** Validate Amount *********/
    // validate staked amount
    function _preValidateStake(address staker, uint256 stakedAmount) internal override view {
        super._preValidateStake(staker, stakedAmount);
        require(stakedTotalAmount.add(stakedAmount) <= cap, "StakingLimit: cap exceeded");
        TokenVestingInfo memory info = tokenVestingList[staker];
        require(info.stakedAmount.add(stakedAmount) <= maxStakingAmount, "StakingLimit: maxStakingAmount exceeded");
        require(stakedAmount >= minStakingAmount, 'StakingLimit: The minimum staking amount does not meet the requirements');
    }

    // calc rate receive amount
    function _getOutTokenAmount(address rewardsToken, uint256 stakedAmount) internal view returns (uint256) {
        RewardsRateInfo memory info = rewardsRateInfoList[rewardsToken];
        return stakedAmount.mul(info.rewardsRate).div(rateDenominator);
    }

    /********** User Functions *********/
    // exec
    function _deliverTokens(address vestingToken, uint256 stakedAmount) internal override {
        if (rewardsTokenList.length > 0) {
            for (uint256 i = 0; i < rewardsTokenList.length; i++) {
                uint256 receivedAmount = _getOutTokenAmount(rewardsTokenList[i], stakedAmount);
                // rewards token transfer to vesting contract
                IERC20(rewardsTokenList[i]).safeTransferFrom(tokenWallet, vestingToken, receivedAmount);
            }
        }
    }

    /********** Query Functions *********/
    /**
     * @dev get _stakerMemberList
     */
    function getStakerMemberList() public onlyOwner view returns (address[] memory) {
        return _stakerMemberList;
    }

    /**
     * @dev get rewardsTokenList
     */
    function getRewardsTokenList() public view returns (address[] memory) {
        return rewardsTokenList;
    }

    /**
     * @dev get vestingAddress list from the tokenVestingList
     */
    function getTokenVestingAddressByAccount(address account) public view returns (address[] memory) {
        TokenVestingInfo storage info = tokenVestingList[account];
        return info.vestingAddress;
    }

    /**
     * @dev Checks whether the cap has been reached.
     * @return Whether the cap was reached
     */
    function capReached() public view returns (bool) {
        return stakedTotalAmount >= cap;
    }
}
